  .mermaid-main-font {
    font-family: "trebuchet ms", verdana, arial, sans-serif;
    font-family: var(--mermaid-font-family);
  }
  .exclude-range {
    fill: ${r.excludeBkgColor};
  }

  .section {
    stroke: none;
    opacity: 0.2;
  }

  .section0 {
    fill: ${r.sectionBkgColor};
  }

  .section2 {
    fill: ${r.sectionBkgColor2};
  }

  .section1,
  .section3 {
    fill: ${r.altSectionBkgColor};
    opacity: 0.2;
  }

  .sectionTitle0 {
    fill: ${r.titleColor};
  }

  .sectionTitle1 {
    fill: ${r.titleColor};
  }

  .sectionTitle2 {
    fill: ${r.titleColor};
  }

  .sectionTitle3 {
    fill: ${r.titleColor};
  }

  .sectionTitle {
    text-anchor: start;
    // font-size: ${r.ganttFontSize};
    // text-height: 14px;
    font-family: 'trebuchet ms', verdana, arial, sans-serif;
    font-family: var(--mermaid-font-family);

  }


  /* Grid and axis */

  .grid .tick {
    stroke: ${r.gridColor};
    opacity: 0.8;
    shape-rendering: crispEdges;
    text {
      font-family: ${r.fontFamily};
      fill: ${r.textColor};
    }
  }

  .grid path {
    stroke-width: 0;
  }


  /* Today line */

  .today {
    fill: none;
    stroke: ${r.todayLineColor};
    stroke-width: 2px;
  }


  /* Task styling */

  /* Default task */

  .task {
    stroke-width: 2;
  }

  .taskText {
    text-anchor: middle;
    font-family: 'trebuchet ms', verdana, arial, sans-serif;
    font-family: var(--mermaid-font-family);
  }

  // .taskText:not([font-size]) {
  //   font-size: ${r.ganttFontSize};
  // }

  .taskTextOutsideRight {
    fill: ${r.taskTextDarkColor};
    text-anchor: start;
    // font-size: ${r.ganttFontSize};
    font-family: 'trebuchet ms', verdana, arial, sans-serif;
    font-family: var(--mermaid-font-family);

  }

  .taskTextOutsideLeft {
    fill: ${r.taskTextDarkColor};
    text-anchor: end;
    // font-size: ${r.ganttFontSize};
  }

  /* Special case clickable */
  .task.clickable {
    cursor: pointer;
  }
  .taskText.clickable {
    cursor: pointer;
    fill: ${r.taskTextClickableColor} !important;
    font-weight: bold;
  }

  .taskTextOutsideLeft.clickable {
    cursor: pointer;
    fill: ${r.taskTextClickableColor} !important;
    font-weight: bold;
  }

  .taskTextOutsideRight.clickable {
    cursor: pointer;
    fill: ${r.taskTextClickableColor} !important;
    font-weight: bold;
  }

  /* Specific task settings for the sections*/

  .taskText0,
  .taskText1,
  .taskText2,
  .taskText3 {
    fill: ${r.taskTextColor};
  }

  .task0,
  .task1,
  .task2,
  .task3 {
    fill: ${r.taskBkgColor};
    stroke: ${r.taskBorderColor};
  }

  .taskTextOutside0,
  .taskTextOutside2
  {
    fill: ${r.taskTextOutsideColor};
  }

  .taskTextOutside1,
  .taskTextOutside3 {
    fill: ${r.taskTextOutsideColor};
  }


  /* Active task */

  .active0,
  .active1,
  .active2,
  .active3 {
    fill: ${r.activeTaskBkgColor};
    stroke: ${r.activeTaskBorderColor};
  }

  .activeText0,
  .activeText1,
  .activeText2,
  .activeText3 {
    fill: ${r.taskTextDarkColor} !important;
  }


  /* Completed task */

  .done0,
  .done1,
  .done2,
  .done3 {
    stroke: ${r.doneTaskBorderColor};
    fill: ${r.doneTaskBkgColor};
    stroke-width: 2;
  }

  .doneText0,
  .doneText1,
  .doneText2,
  .doneText3 {
    fill: ${r.taskTextDarkColor} !important;
  }


  /* Tasks on the critical line */

  .crit0,
  .crit1,
  .crit2,
  .crit3 {
    stroke: ${r.critBorderColor};
    fill: ${r.critBkgColor};
    stroke-width: 2;
  }

  .activeCrit0,
  .activeCrit1,
  .activeCrit2,
  .activeCrit3 {
    stroke: ${r.critBorderColor};
    fill: ${r.activeTaskBkgColor};
    stroke-width: 2;
  }

  .doneCrit0,
  .doneCrit1,
  .doneCrit2,
  .doneCrit3 {
    stroke: ${r.critBorderColor};
    fill: ${r.doneTaskBkgColor};
    stroke-width: 2;
    cursor: pointer;
    shape-rendering: crispEdges;
  }

  .milestone {
    transform: rotate(45deg) scale(0.8,0.8);
  }

  .milestoneText {
    font-style: italic;
  }
  .doneCritText0,
  .doneCritText1,
  .doneCritText2,
  .doneCritText3 {
    fill: ${r.taskTextDarkColor} !important;
  }

  .activeCritText0,
  .activeCritText1,
  .activeCritText2,
  .activeCritText3 {
    fill: ${r.taskTextDarkColor} !important;
  }

  .titleText {
    text-anchor: middle;
    font-size: 18px;
    fill: ${r.textColor}    ;
    font-family: 'trebuchet ms', verdana, arial, sans-serif;
    font-family: var(--mermaid-font-family);
  }

.node .fork-join {
  fill: ${r.specialStateColor};
  stroke: ${r.specialStateColor};
}

.node circle.state-end {
  fill: ${r.innerEndBackground};
  stroke: ${r.background};
  stroke-width: 1.5
}
.end-state-inner {
  fill: ${r.compositeBackground||r.background};
  // stroke: ${r.background};
  stroke-width: 1.5
}

.node rect {
  fill: ${r.stateBkg||r.mainBkg};
  stroke: ${r.stateBorder||r.nodeBorder};
  stroke-width: 1px;
}
.node polygon {
  fill: ${r.mainBkg};
  stroke: ${r.stateBorder||r.nodeBorder};;
  stroke-width: 1px;
}
#statediagram-barbEnd {
  fill: ${r.lineColor};
}

.statediagram-cluster rect {
  fill: ${r.compositeTitleBackground};
  stroke: ${r.stateBorder||r.nodeBorder};
  stroke-width: 1px;
}

.cluster-label, .nodeLabel {
  color: ${r.stateLabelColor};
}

.statediagram-cluster rect.outer {
  rx: 5px;
  ry: 5px;
}
.statediagram-state .divider {
  stroke: ${r.stateBorder||r.nodeBorder};
}

.statediagram-state .title-state {
  rx: 5px;
  ry: 5px;
}
.statediagram-cluster.statediagram-cluster .inner {
  fill: ${r.compositeBackground||r.background};
}
.statediagram-cluster.statediagram-cluster-alt .inner {
  fill: ${r.altBackground?r.altBackground:"#efefef"};
}

.statediagram-cluster .inner {
  rx:0;
  ry:0;
}

.statediagram-state rect.basic {
  rx: 5px;
  ry: 5px;
}
.statediagram-state rect.divider {
  stroke-dasharray: 10,10;
  fill: ${r.altBackground?r.altBackground:"#efefef"};
}

.note-edge {
  stroke-dasharray: 5;
}

.statediagram-note rect {
  fill: ${r.noteBkgColor};
  stroke: ${r.noteBorderColor};
  stroke-width: 1px;
  rx: 0;
  ry: 0;
}
.statediagram-note rect {
  fill: ${r.noteBkgColor};
  stroke: ${r.noteBorderColor};
  stroke-width: 1px;
  rx: 0;
  ry: 0;
}

.statediagram-note text {
  fill: ${r.noteTextColor};
}

.statediagram-note .nodeLabel {
  color: ${r.noteTextColor};
}
.statediagram .edgeLabel {
  color: red; // ${r.noteTextColor};
}

#dependencyStart, #dependencyEnd {
  fill: ${r.lineColor};
  stroke: ${r.lineColor};
  stroke-width: 1;
}

.statediagramTitleText {
  text-anchor: middle;
  font-size: 18px;
  fill: ${r.textColor};
}
